(window.webpackJsonp=window.webpackJsonp||[]).push([[191],{191:function(e){e.exports=JSON.parse('{"id":"web/12.web-optimize/http-cache","title":"http缓存","sidebar_label":"http缓存","description":"使用http缓存可以将一些静态资源缓存在本地，当下次使用时不必再向服务器请求缓存过的资源，这样可以节省网络带宽和资源加载的时间。协商缓存虽然不再请求资源，但仍然需要向服务器询问缓存资源是否过期，所以对于http缓存，我们尽量使用强制缓存。","source":"@site/docs/web/12.web-optimize/http-cache.md","permalink":"/docsite/docs/web/12.web-optimize/http-cache","sidebar":"web","category":"12.web网页性能优化","next":"web/13.rendering-engine/rendering-engine","previous":"web/12.web-optimize/delay-loading","previous_title":"延时加载资源","next_title":"浏览器内核"}')}}]);